import Meal from './Meal';
import Quiz from './Quiz';

function App() {
  return (
    <div className="App">
      <body className="body">
    <main>
        <header role="banner">
        <Nav />
            <h1 className="header">HI, I'M ROSS</h1>
            <h2 className="header">full stack web developer in the San Francisco bay area</h2>
        </header>
        <Aboutexperience />
        <section className="projectsHeader">
            <h4>projects</h4>
        </section>
        <Meal />
        <Quiz />    
    </main>
    <Footer />
</body>
    </div>
  );
}

export default App;
